import mainimg from '../img/main.jpg'; // with import

class Titles extends Component{


    render(){

        return (
            <div>
                <div className="title-outer"> 
                    <img src={mainimg} alt="image of runner" height="50" width="50"> </img>
                </div>
            </div>
            )
    }
};

export default Titles;
